arCallbacks.szOnCallbackCompleteScript:
function Start(idActor, idActorDetector)

	Hydra.ActorPlaySimpleConversation(S_CONV_CO_KEIRON, idKeironIntro)

end

function Start(idActorDamager, idActorDamaged)

	Hydra.ActorEnable(idLunaticSpawner);
	
end

function Start(idActor, idActorDetector)

	Hydra.ActorEnable(idArcherSpawner);
	
	local ambushSkeletons = Hydra.ActorsInGroup("Camp_KeironsPyre_SkeletonAmbush");
	
	Hydra.Wait(1);
	for i, idSkeleton in ipairs(ambushSkeletons) do
		Hydra.QActorAnim(idSkeleton, "Summoned_Animating_Ground");
	
--		Hydra.WaitForQEmpty(idSkeleton);
		Hydra.Wait(1)
	
		Hydra.ActorSetInvulnerable(idSkeleton, false);
		Hydra.ActorEnableAI(idSkeleton, true);
		Hydra.ActorSetTargetable(idSkeleton, true);
	
		Hydra.ActorClearAnimSetOverride(idSkeleton);
		Hydra.Wait(1);
	end
	
end

function Start(idActorDamager, idActorDamaged)

	Hydra.ActorEnable(idBallistaSpawner);
	
	
	
end

function Start(idActorPlayer, snoSubzone)

	Camps.PlayIntroConv(idActorPlayer, CONV_INTRO, S_GBID_PV_HAS_PLAYED_INTRO)

end

function Start(idActorPlayer, idItem)
	table.remove(tPlayersWithItem, idActorPlayer)
end

function Start(idActorPlayer, sLevelAreaName)
	Hydra.MusicOverride("Sanctuary_Eastern_Continent", "Music_Hawezar_Verge_Stronghold_Hostile")
end

function Start(sWorldName, sLevelAreaName)
	
	local boss = Hydra.ActorsInGroup("Camp_KeironsPyre_Boss");
	
	for i, bossID in ipairs(boss) do
		Hydra.ActorFadeAndDelete(bossID, 2);
	end
	
end

arQuestPhases.szOnEnterScript:
--spawn boss
local boss = Hydra.ActorsInGroup("Camp_KeironsPyre_Boss");
	
for i, bossID in ipairs(boss) do

	-- Enable Boss
	Hydra.ActorEnable(bossID);
	Hydra.ActorTriggerPowerAtFeet(bossID, bossIntroPower);

end

Hydra.BossEncounterManuallyQueueStart(BOSS_ENCOUNTER_LEVEL_AREA);

arCallbacks.szOnCallbackCompleteScript:
function Start(idActorPlayer, idActorGizmo)
	Camps.ClaimCamera(idActorPlayer, idActorGizmo);
	Hydra.ClearMusicOverride("Sanctuary_Eastern_Continent")
end

function Start(idActor, idActorDetector)
	
	if(Hydra.ActorIsAlive(idActor)) then
	
		Hydra.EventSend("StartKeironsPyreBoss");
	
	end
	
end

